const Card = (props) => {
  return (
    <div className="col">
      <div className="Card" style={{ width: "18rem", height: "2%" }}>
        <img className="ca" src={props.src} />
        <div>
          <h1>{props.name}</h1>
          <p>{props.description}</p>
          <h3>{props.price}</h3>
          <button>Add</button>
        </div>
      </div>
    </div>
  );
};

